import './App.css';
import React from 'react';
// import firebase from "firebase/compat/app";
// import messaging from "firebase/compat/app"
// import {firebase} from 'firebase/app';
import 'firebase/compat/messaging';

// import { initializeApp,messaging} from "firebase/compat/app";
// import { getAnalytics } from "firebase/analytics";
// import "@firebase/compat/auth";
import "firebase/compat/auth"
import "firebase/compat/firestore"
import Services from './components/pages/Services';
import Trailer from './components/pages/Trailer';
import About from './components/pages/About';
import SignUp from './components/pages/SignUp';
import Blogg from './components/pages/Blogg';
import Home from './components/pages/Home';
import Navbar from './components/Navbar';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom'
import HeroSection from './components/HeroSection';
import Footer from './components/Footer';

import firebase from './Firebase';


function App() {
  React.useEffect(()=>{
    const msg=firebase.messaging();
    msg.requestPermission()
    .then(()=>{
      return msg.getToken();
    })
    .then(token=>{
      console.log("token",token);
    })
    .catch(error=>{
      console.log(error);
    })
  })


  return (

    <Router>
      <div className="App">
        <div>return push notification</div>
        <Navbar/>

        <Switch>
        <Route path='/blogg' component={Blogg} />
          <Route path='/' exact component={Home}/>
          <Route path='/services' component={Services} />
          <Route path='/trailer' component={Trailer} />
          <Route path='/about' component={About} />
          <Route path='/sign-up' component={SignUp} />
        </Switch>
        <Footer />
      </div>
    </Router>

  );
}

export default App;
